#include <iostream>
#include <vector>
#include <stack>
//if we used recursion,we will get segment fault because the depth of the recursion is too long,so we use stack to store the element
using namespace std;
class Solution {
    //using two variables to define the border
    int m = 0;
    int n = 0;
    vector<vector<bool>> toSolve;
    vector<vector<bool>> visit;
    bool doNotCover;
public:
    void solve(vector<vector<char>>& board) {
        m = board.size();
        if(m==0){
            return;
        }
        n = board[0].size();
        doNotCover = false;
        vector<vector<bool>> visit1(m,vector<bool>(n,false));
        visit = visit1;
        vector<vector<bool>> toSolve2(m,vector<bool>(n,false));
        toSolve = toSolve2;
        for(int i = 0;i<m;i++){
            for(int j = 0;j<n;j++){
                if(!visit[i][j] && board[i][j]=='O'){
                    if(i==0 || j ==0 || i==m-1 || j==n-1) doNotCover=true;
                    toSolve[i][j]=true;
                    _iter(board,i,j);
                    solveIter(doNotCover,board);
                    doNotCover=false;
                }
            }
        }
        cout<<endl;
    }
    void solveIter(bool doNotCover,vector<vector<char>>& board){

        for(int i = 0;i<m;i++){
            for(int j = 0;j<n;j++){
                if(toSolve[i][j]){
                    if(doNotCover){
                        visit[i][j]=true;
                    }else{
                        board[i][j]='X';
                    }
                    toSolve[i][j]=false;
                }
            }
        }


    }
    void _iter(vector<vector<char>>& grid,int startX,int startY){
         cout<<startX<<startY<<endl;
        stack<pair<int,int>> s;
        s.push(make_pair(startX,startY+1));
        s.push(make_pair(startX,startY-1));
        s.push(make_pair(startX+1,startY));
        s.push(make_pair(startX-1,startY));
        while(!s.empty()){
            int x = s.top().first;
            int y = s.top().second;
            s.pop();
            if(x>=0 && x<m && y>=0 && y<n && !visit[x][y] && !toSolve[x][y] && grid[x][y] == 'O'){
                if(x==0 || y ==0 || x==m-1 || y==n-1) doNotCover= true;
                toSolve[x][y]=true;
                s.push(make_pair(x,y+1));
                s.push(make_pair(x,y-1));
                s.push(make_pair(x+1,y));
                s.push(make_pair(x-1,y));
            }
        }
    }
};
